/**
 * @param {string} str1
 * @param {string} str2
 * @return {string}
 */
var gcdOfStrings = function (str1, str2) {
  let stringSet = new Set
  for (let i = 0; i < str1.length; i++) {
    for (let j = 0; j < str2.length; j++) {
      if (str1[i] == str2[j]) {
        stringSet.add(str1[i])
      }

    }

  }
  let result = Array.from(stringSet)
  return result.join("")
};